INSERT INTO `post_details` (`id`, `title`, `image`, `content`, `index`, `post_id`) VALUES
(1, 'Lập trình PHP có khó không? Góc nhìn dành cho người mới', NULL, 'Nhiều người nghĩ rằng lập trình là lĩnh vực phức tạp, nhưng với PHP, mọi thứ trở nên đơn giản hơn. PHP có cú pháp dễ hiểu, nhiều tài liệu hỗ trợ và được sử dụng phổ biến trong phát triển web. Nếu bạn mới bắt đầu, hãy thử làm quen với những khái niệm cơ bản như biến, vòng lặp và hàm.', 2, 1);
INSERT INTO `post_details` (`id`, `title`, `image`, `content`, `index`, `post_id`) VALUES
(2, 'Tại sao PHP là lựa chọn tốt cho người học lập trình?', NULL, '<p><u><b>PHP không chỉ dễ học mà còn có khả năng ứng dụng cao trong thực tế. Với PHP, bạn có thể nhanh chóng tạo ra một website động, kết nối cơ sở dữ liệu hoặc tích hợp các công cụ mạnh mẽ như Laravel hay Symfony. Đây là lý do tại sao PHP là bước khởi đầu lý tưởng.</b></u></p><p><img src=\"data:image/png;base64,\" data-filename=\"course5_module3.png\" style=\"width: 541.5px;\"><u><b><br></b></u></p>', 1, 1);
INSERT INTO `post_details` (`id`, `title`, `image`, `content`, `index`, `post_id`) VALUES
(3, 'PHP có thực sự dễ học? Điều gì khiến người học gặp khó khăn?', NULL, 'Dù PHP được coi là dễ học, nhưng không tránh khỏi những khó khăn khi bạn mới tiếp xúc. Một số thách thức thường gặp bao gồm: hiểu logic lập trình, xử lý lỗi cú pháp, và làm việc với cơ sở dữ liệu. Tuy nhiên, khi thực hành thường xuyên, bạn sẽ cảm thấy những điều này dần trở nên quen thuộc.', 3, 1),
(4, 'Bí quyết học PHP hiệu quả cho người mới bắt đầu', NULL, 'Tập trung vào việc học cú pháp cơ bản như khai báo biến, viết hàm, và điều kiện.\r\nXem các video hướng dẫn hoặc tham gia khóa học online để có lộ trình học tập rõ ràng.\r\nThực hành làm các bài tập nhỏ, ví dụ: tạo một form đăng ký và lưu dữ liệu vào cơ sở dữ liệu.', 4, 1),
(5, 'Học PHP nhanh chóng với các công cụ hỗ trợ\r\n', NULL, 'Để học PHP hiệu quả, hãy tận dụng các công cụ hỗ trợ như XAMPP, Laragon để tạo môi trường phát triển. Ngoài ra, các IDE như VS Code hoặc PhpStorm cũng giúp bạn viết mã nhanh và chính xác hơn nhờ tính năng gợi ý cú pháp.', 5, 1),
(6, 'Có cần biết kiến thức gì trước khi học PHP?', NULL, 'Bạn không cần quá nhiều kiến thức trước khi học PHP. Tuy nhiên, nếu bạn hiểu một chút về HTML, CSS và logic lập trình cơ bản, việc học PHP sẽ dễ dàng hơn. Những khái niệm này sẽ giúp bạn kết nối giữa PHP và các công nghệ web khác.', 6, 1);
INSERT INTO `post_details` (`id`, `title`, `image`, `content`, `index`, `post_id`) VALUES
(12, '1. Tổng quan kiến thức về Laravel', NULL, '<p style=\"text-align: justify;\"><font color=\"#000000\">Laravel thường được các lập trình viên dùng để tạo các ứng dụng web PHP (tùy chỉnh). Nó là một cấu trúc web xử lý được nhiều khía cạnh như các template HTML (và xác thực) và định tuyến khi thiết lập. Vì hoạt động ở máy chủ, Laravel thường tập trung vào việc xử lý các dữ liệu và duy trì thiết kế của bộ điều khiển (ở chế độ xem mô hình). Laravel hoàn toàn thuộc về phía máy chủ.</font></p><h4 style=\"text-align: justify;\" class=\"\">Laravel là gì?</h4><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><font color=\"#000000\">Laravel là gì? Đây là<a href=\"https://vinahost.vn/ma-nguon-mo-la-gi/\" style=\"touch-action: manipulation;\">&nbsp;</a>mã nguồn mở và được phát triển nhằm hỗ trợ các bạn lập trình viên phát triển đa dạng các phần mềm, ứng dụng web và trang web theo mô hình MVC. Nhờ có Laravel, việc xây dựng và phát triển ứng dụng dễ dàng và hiệu quả. Laravel lần đầu ra mắt công chúng vào năm 2011. Đến nay, PHP Laravel có đa dạng các tính năng:</font></p><p class=\"\"></p><p></p><ul><ul></ul></ul><ul><ul></ul></ul><ul><ul></ul></ul><ul><ul></ul></ul><ul><ul></ul></ul><ul><ul></ul></ul><ul><ul></ul></ul><p></p><ul><li style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"text-align: left; font-family: Arial;\"><font color=\"#000000\">Cơ chế định tuyến đa cấp</font></span></li><li style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"text-align: left; font-family: Arial;\"><font color=\"#000000\">Tạo lập truy vấn dữ liệu nhanh gọn</font></span></li><li style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"text-align: left; font-family: Arial;\"><font color=\"#000000\">Cơ chế xử lý lỗi</font></span></li><li style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"text-align: left; font-family: Arial;\"><font color=\"#000000\">Tiếp cận đối tượng nhanh chóng&nbsp;</font></span></li><li style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"text-align: left; font-family: Arial;\"><font color=\"#000000\">Có tính năng bảo mật cao</font></span></li><li style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"text-align: left; font-family: Arial;\"><font color=\"#000000\">Có thư viện mở rộng&nbsp;</font></span></li><li style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"text-align: left; font-family: Arial;\"><font color=\"#000000\">Một số tính năng khác giúp phát triển và quản lý ứng dụng thuận tiện</font></span></li></ul><h2 class=\"\"></h2><h4 class=\"\"></h4><h4 class=\"\"><ul><li style=\"text-align: left; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">Framework là gì?</li></ul><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><font color=\"#000000\">Framework Laravel là gì? Nó đơn giản là một thư viện với các tài nguyên sẵn có ở một số lĩnh vực để các bạn có thể sử dụng ngay (không phải mất thời gian tự thiết kế). Khi sở hữu framework, các bạn chỉ cần tìm hiểu và khai thác nguồn tài nguyên đó.&nbsp;</font></p><ul><li style=\"text-align: left; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><font color=\"#000000\">Trong quá trình làm việc, các bạn nên kết nối chúng lại cùng nhau để tạo thành sản phẩm hoàn thiện. Mỗi bạn lập trình viên đang làm việc ở một lĩnh vực nhất định nào đó, các bạn nên thiết lập các lớp riêng biệt về chương trình để tạo nên hệ thống các phần mềm và ứng dụng thành phẩm.</font></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 50%;\"><font color=\"#000000\"><br></font></p><h4 style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\" class=\"\"><font color=\"#000000\">PHP Framework là gì?</font></h4><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\" class=\"\"><font color=\"#000000\"><span style=\"text-align: start;\">PHP framework là thư viện để làm tiền đề phát triển các ứng dụng web được lập trình bằng ngôn ngữ PHP. Nhờ có framework, các ứng dụng web trở nên mượt mà hơn. Khi cung cấp một cấu trúc cơ bản để tạo ứng các ứng dụng đó, công việc của các bạn sau này sẽ tiết kiệm thời gian và công sức.&nbsp;</span><span style=\"text-align: start;\">PHP framework giúp các bạn đẩy mạnh quá trình phát triển ứng dụng và tăng tính ổn định cho nó. Đồng thời, PHP framework còn giảm số lần phải viết lại code.&nbsp;</span></font></p><h4 style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\" class=\"\"><font color=\"#000000\"><span style=\"text-align: start;\">Mô hình MVC là gì?</span></font></h4><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(0, 0, 0);\"><span style=\"font-weight: 700;\">Mô hình MVC (Model View Controller)</span>&nbsp;là kiểu kiến trúc phần mềm trên máy tính để tạo lập giao diện cho người dùng. Hệ thống này thường chia thành 3 phần có khả năng tương tác cùng nhau và thậm chí tách biệt các nguyên tắc nghiệp vụ với giao diện người dùng.&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><font color=\"#000000\"><b>&nbsp; &nbsp;Controller:</b>&nbsp;có nhiệm vụ nhận điều hướng các yêu cầu từ người dùng và gọi chính xác các phương thức để xử lý<br></font></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><font color=\"#000000\"><b>&nbsp; &nbsp;Model</b>:&nbsp;thành phần chứa đầy đủ các nghiệp vụ logic, phương thức xử lý, truy xuất dữ liệu, giám sát các đối tượng mô tả dữ liệu như class và hàm xử lý<br></font></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><font color=\"#000000\"><b>&nbsp; &nbsp;View</b>:&nbsp;có trách nhiệm hiển thị thông tin để tương tác với người dùng. Đồng thời, nó cũng là nơi chứa tất cả đối tượng GUI (textbox, images,…)</font></p><ul><li><ol style=\"list-style: disc; margin-bottom: 20px;\"><p></p><p></p><p class=\"\"></p><p></p><p></p></ol></li></ul><p></p><p class=\"\"></p><p></p><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\" class=\"\"><font color=\"#000000\"><span style=\"text-align: start;\"></span></font></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(0, 0, 0);\">Thông tin nội hàm có thể được xử lý tách biệt với phần thông tin xuất hiện trong giao diện người dùng. Các nguyên tắc làm việc và đạo đức của người lập trình được giữ vững.</p></li></ul></h4><p></p><p style=\"text-align: center; \"><br></p>', 7, 27);
INSERT INTO `post_details` (`id`, `title`, `image`, `content`, `index`, `post_id`) VALUES
(13, '2. Lịch sử hình thành và phát triển của Laravel', NULL, '<p class=\"\" style=\"text-align: justify; \"><font color=\"#000000\">Cha đẻ của Laravel là ông Taylor Otwell. Ông này đã cho ra mắt Laravel vào tháng 6 năm 2011 vì ông muốn nó là giải pháp thay thế CodeIgniter. Với framework này, các bạn lập trình có thể sử dụng các tính năng mới. Tính đến nay, Laravel đã có đến phiên bản 5.8 và nhiều cải tiến phong phú.</font></p>', 8, 27);
INSERT INTO `post_details` (`id`, `title`, `image`, `content`, `index`, `post_id`) VALUES
(14, '3. Ưu điểm và nhược điểm của Framework Laravel', NULL, '<p class=\"\"></p><p class=\"\"><h6 class=\"\"><p class=\"\"><ul><li style=\"text-align: justify; \"><font color=\"#000000\"><span style=\"font-family: Arial;\">﻿</span><span style=\"font-family: Arial;\">Dù Laravel được các lập trình viên thế giới yêu thích và ưa chuộng sử dụng, framework này cũng có các ưu thế và nhược điểm nhất định. Trước khi cài đặt sử dụng, các bạn cần tìm hiểu cả 2 để có nhận định khách quan hơn về Laravel.</span></font></li></ul></p></h6></p><p></p><p class=\"\" style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 50%;\"></p><h4 class=\"\"><font color=\"#000000\"><h4 class=\"\"></h4><h5 class=\"\"></h5><h4 style=\"text-align: justify;\" class=\"\"><span style=\"font-family: Arial;\">Ưu điểm:</span></h4><p style=\"text-align: justify;\" class=\"\"><font color=\"#000000\"><span style=\"text-align: left; font-weight: 700; font-family: Arial;\">Luôn cập nhật các tính năng mới nhất của PHP:</span><span style=\"text-align: left; font-family: Arial;\">&nbsp;khi các bạn dùng phiên bản 5.0 trở lên, các bạn sẽ được tiếp cận toàn bộ các tính năng mới nhất của PHP. Ví dụ như Namespaces, Interfaces, Overloading, các chức năng ẩn danh và Shorter array syntax.</span></font><span style=\"color: rgb(0, 0, 0); text-align: left; font-weight: 700;\"><br></span></p><p style=\"text-align: justify;\" class=\"\"><font color=\"#000000\"><span style=\"text-align: left; font-weight: 700; font-family: Arial;\">Đa dạng nguồn tài nguyên và chúng luôn có sẵn:</span><span style=\"text-align: left; font-family: Arial;\">&nbsp;nguồn tài nguyên của Laravel gần như là vô hạn. Các bạn có thể dùng nhiều tài liệu khác nhau để tham khảo. Tất cả phiên bản được phát hành đều có nguồn tài liệu tương thích với ứng dụng của các bạn.</span></font></p><p style=\"text-align: justify;\" class=\"\"><font color=\"#000000\"><span style=\"text-align: left; font-family: Arial;\">...</span></font></p><h4 style=\"text-align: justify;\" class=\"\"><font color=\"#000000\"><span style=\"text-align: left; font-family: Arial;\">Nhược điểm:</span></font></h4><p style=\"text-align: justify;\" class=\"\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\"><span style=\"text-align: left; font-weight: 700; font-family: Arial;\">Không hỗ trợ tính năng thanh toán:</span><span style=\"text-align: left; font-family: Arial;\">&nbsp;nếu bạn phải tự thanh toán các khoản quản lý, thì bạn sẽ phải tuân thủ các nguyên tắc PCI. Các bạn lập trình mới vào nghề sẽ thử các trang web thương mại trực tuyến và xây dựng ứng dụng trong kho template có sẵn. Thậm chí, các bạn có thể sử dụng các thư viện của framework để tích hợp các phương thức thanh toán. Tuy nhiên, đa phần các lập trình viên lão làng hoặc nhà giao dịch điện tử nhúng bộ xử lý thanh toán của bên thứ 3 để thuận tiện.&nbsp;</span></font></p><p style=\"text-align: justify;\" class=\"\"><font color=\"#000000\" style=\"background-color: rgb(255, 255, 255);\"><span style=\"text-align: left; font-family: Arial;\">...</span></font></p><p style=\"text-align: justify;\" class=\"\"><font color=\"#000000\"><span style=\"text-align: left;\"><br></span></font></p></font></h4><ul><li style=\"text-align: justify; \"><font color=\"#000000\"><br></font></li></ul><p></p><font color=\"#000000\"><p></p><p></p><p></p></font><p></p><p></p><font color=\"#000000\"><p></p><p></p><p></p><p></p><p class=\"\"></p></font><p></p><p></p>', 9, 27);

